	let orderId = useParams();
	const getOrder = () => {
		axios.get(`/get-order-products/${orderId}`,)
	}

	useEffect(()=>{
		//get order
		getOrder();
	},[])

	return (
	  <AdminLayout>
		<div>
		</div>
	  </AdminLayout>
	);
}

export default OrderProducts;
